import React from 'react';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Container from 'react-bootstrap/Container';

class Social extends React.Component {
  render() {
    return (
      <Container>
        <Row>
          <Col>
            <img
              src={require("/src/Images/contactImages/JumboContactImg.png")}
              alt="Contact Social Image"
              width="400px"
              height="350px"
            />
          </Col>

          <Col>
            <h8>SOCIAL MEDIA</h8>
            <p3>Follow us across social media for the latest updates and tips on how to get the best out of our service! We post the key stats for each gameweek in an easy to understand format so you take advantage.</p3>
              <a href="https://twitter.com/BetHeroUK" className="align-self-center">
                <img className="icons" src="./Images/contactImages/TwitterIconBlack.png" alt="Twitter Icon" width="40px"
                height="30px" />
              </a>
              <a href="https://twitter.com/BetHeroUK" className="align-self-center">
                <img className="icons" src="./Images/contactImages/InstaIconBlack.png" alt="Insta Icon" width="30px"
                height="30px" />
              </a>
              <a href="https://twitter.com/BetHeroUK" className="align-self-center">
                <img className="icons" src="./Images/contactImages/FacebookIconBlack.png" alt="Facebook Icon" width="30px"
                height="30px" />
              </a>
          </Col>
        </Row>
      </Container>
    )
  }
}
export default Social;
